webpackJsonp([0x66c2204059d8],{392:function(e,t){e.exports={data:{postBySlug:{html:'<h5 id="Оглавление"><a href="#%D0%9E%D0%B3%D0%BB%D0%B0%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Оглавление</h5>\n<ul>\n<li><a href="#%D0%9E%D0%BF%D0%B8%D1%81%D0%B0%D0%BD%D0%B8%D0%B5">Описание</a></li>\n<li><a href="#%D0%9F%D1%80%D0%B8%D0%BC%D0%B5%D1%80">Пример</a></li>\n<li><a href="#process-data">Process Data</a></li>\n<li><a href="#%D0%9F%D0%B0%D1%80%D0%B0%D0%BC%D0%B5%D1%82%D1%80%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F-%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB%D0%BE%D0%B2">Параметризация каналов</a></li>\n<li><a href="#%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D0%BA%D0%B0%D1%86%D0%B8%D1%8F-%D1%81-%D0%BC%D0%BE%D0%B4%D1%83%D0%BB%D0%B5%D0%BC">Коммуникация с модулем</a></li>\n<li><a href="#%D0%92%D1%8B%D0%B2%D0%BE%D0%B4-%D0%B7%D0%BD%D0%B0%D1%87%D0%B5%D0%BD%D0%B8%D0%B8%CC%86-%D0%B8-%D0%B4%D0%B8%D0%B0%D0%B3%D0%BD%D0%BE%D1%81%D1%82%D0%B8%D0%BA%D0%B0">Вывод значений и диагностика</a></li>\n</ul>\n<h2 id="Описание"><a href="#%D0%9E%D0%BF%D0%B8%D1%81%D0%B0%D0%BD%D0%B8%D0%B5" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Описание</h2>\n<p>Модуль <a href="https://www.phoenixcontact.com/online/portal/ru/?uri=pxc-oc-itemdetail:pid=2700459&#x26;library=ruru&#x26;tab=5">2700459 IB IL AI 4/U-PAC</a>\nслужит для ввода сигналов напряжения 0-10 В, ±10 В.</p>\n<h2 id="Пример"><a href="#%D0%9F%D1%80%D0%B8%D0%BC%D0%B5%D1%80" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Пример</h2>\n<p>Пример работы с модулем на <a href="https://github.com/axhelp/examples-analog-technology">Github</a></p>\n<h2 id="process-data"><a href="#process-data" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Process Data</h2>\n<p>На шине модуль представлен 4 словами для принятия сигналов напряжения и 4 словами для конфигурации каналов (для обработки\n<strong>вручную</strong>).<br>\nLWORD <strong>~AI64</strong> и <strong>~AO 64</strong> содержат те же данные, что и отдельные слова, но собраны в одну переменную (для обработки\n<strong>библиотекой</strong>)</p>\n<p><img src="https://github.com/axhelp/examples-analog-technology/blob/master/images/IB-IL-AI-4-U/process-data.png?raw=true" alt="IB IL AI 4/U-PAC Process Data"></p>\n<h2 id="Параметризация-каналов"><a href="#%D0%9F%D0%B0%D1%80%D0%B0%D0%BC%D0%B5%D1%82%D1%80%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F-%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB%D0%BE%D0%B2" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Параметризация каналов</h2>\n<p>Параметризация каналов осуществляется блоком <strong>IL AI 4 UI Para</strong>.\nДля каждого канала есть возможность установить диапазон измерения (вход <strong>iMode</strong>): </p>\n<ul>\n<li>0 - диапазон 0-10 В</li>\n<li>1 - диапазон ±10 В</li>\n</ul>\n<p>и пределы измерения физической величины (входы <strong>rHighLimit</strong> и <strong>rLowLimit</strong>)</p>\n<p><img src="https://github.com/axhelp/examples-analog-technology/blob/master/images/IB-IL-AI-4-U/parameters.png?raw=true" alt="IB IL AI 4/U-PAC Parameters"></p>\n<h2 id="Коммуникация-с-модулем"><a href="#%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D0%BA%D0%B0%D1%86%D0%B8%D1%8F-%D1%81-%D0%BC%D0%BE%D0%B4%D1%83%D0%BB%D0%B5%D0%BC" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Коммуникация с модулем</h2>\n<p>Через структуру <strong>udtPara</strong>, проходящую насквозь через все блоки, данные параметризации передаются в блок коммуникации с\nмодулем - <strong>IL<em>AI</em>4<em>UI</em>Com</strong>. Для общения с модулем блок необходимо передать пеерменные <strong>arrProcIn</strong> и <strong>arrProcOut</strong>,\nпривязанные к Process Data модуля.</p>\n<p><img src="https://github.com/axhelp/examples-analog-technology/blob/master/images/IB-IL-AI-4-U/process-data-assignment.png?raw=true" alt="IB IL AI 4/U-PAC Process Data assignment"></p>\n<p>Вход <strong>bSelect</strong> позволяет указать, какие каналы активны.</p>\n<p><img src="https://github.com/axhelp/examples-analog-technology/blob/master/images/IB-IL-AI-4-U/com.png?raw=true" alt="IB IL AI 4/U-PAC Communication"></p>\n<h2 id="Вывод-значений-и-диагностика"><a href="#%D0%92%D1%8B%D0%B2%D0%BE%D0%B4-%D0%B7%D0%BD%D0%B0%D1%87%D0%B5%D0%BD%D0%B8%D0%B8%CC%86-%D0%B8-%D0%B4%D0%B8%D0%B0%D0%B3%D0%BD%D0%BE%D1%81%D1%82%D0%B8%D0%BA%D0%B0" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Вывод значений и диагностика</h2>\n<p>Для вывода значений и диагностики используются блоки <strong>IL<em>AI</em>4<em>UI</em>Diag</strong>, получающие данные от блока коммуникации через\nструктуру udtStatus.<br>\nПреобразованное значение канала содержится на выходе <strong>rCurrentValue</strong>.</p>\n<p><img src="https://github.com/axhelp/examples-analog-technology/blob/master/images/IB-IL-AI-4-U/diag.png?raw=true" alt="IB IL AI 4/U-PAC Process Data assignment"></p>',timeToRead:4,excerpt:"Оглавление Описание Пример Process Data Параметризация каналов Коммуникация с модулем Вывод значений и диагностика Описание Модуль  270045...",frontmatter:{title:"IB IL AI 4/U-PAC",cover:null,date:null,category:null,tags:null}},tableOfContents:{chapters:[{title:"1. Среда разработки",entries:null,chapters:[{title:"1.1 Быстрый старт",entries:null,chapters:[{title:"1.1.1 Загрузка и установка",entries:[{entry:{id:"/home/travis/build/axhelp/axhelp.github.io/content/lessons/1-1-quickstart/pcworx.md absPath of file",childMarkdownRemark:{fields:{slug:"/pc-worx"},frontmatter:{title:"PC WORX"}}}},{entry:{id:"/home/travis/build/axhelp/axhelp.github.io/content/lessons/1-1-quickstart/plcnext.md absPath of file",childMarkdownRemark:{fields:{slug:"/pl-cnext-engineer"},frontmatter:{title:"PLCnext Engineer"}}}}]}]}]},{title:"2. Библиотеки",entries:null,chapters:[{title:"2.1 Analog Technology",entries:[{entry:{id:"/home/travis/build/axhelp/axhelp.github.io/content/lessons/2-1-analog-technology/ib-il-ai-4-i.md absPath of file",childMarkdownRemark:{fields:{slug:"/ib-il-ai-4-i-pac"},frontmatter:{title:"IB IL AI 4/I-PAC"}}}},{entry:{id:"/home/travis/build/axhelp/axhelp.github.io/content/lessons/2-1-analog-technology/ib-il-ai-4-u.md absPath of file",childMarkdownRemark:{fields:{slug:"/ib-il-ai-4-u-pac"},frontmatter:{title:"IB IL AI 4/U-PAC"}}}},{entry:{id:"/home/travis/build/axhelp/axhelp.github.io/content/lessons/2-1-analog-technology/ib-il-ao-2-ui.md absPath of file",childMarkdownRemark:{fields:{slug:"/ib-il-ao-2-ui-pac"},frontmatter:{title:"IB IL AO 2/UI-PAC"}}}}],chapters:null}]},{title:"3. Main Chapter",entries:[{entry:{id:"/home/travis/build/axhelp/axhelp.github.io/content/lessons/lesson_six.md absPath of file",childMarkdownRemark:{fields:{slug:"/lesson-six"},frontmatter:{title:"Lesson Six"}}}}],chapters:null}]}},pathContext:{slug:"/ib-il-ai-4-u-pac"}}}});
